import React from 'react'
import ReactDom from 'react-dom'
import Navbar from './components/Navbar'
import "./App.css"
import { BrowserRouter as Router, Route } from "react-router-dom";
const App = () =>{
    return(
        <Router>
            <Navbar />
            <Route exact path="/">
                <Home />
            </Route>
        </Router>
    )
}

ReactDom.render(<App/>,document.getElementById("root"))
